import React from 'react'

const TransactionItems = ({item}) => {
    return (
       <tr key={item.id}>
      <td>{item.type}</td>
      <td>{item.amount}</td>
         <td>{item.currency}</td>
         </tr>    
    );
}

export default TransactionItems;
